import Navbar from "./components/Navbar/Navbar";
import { BrowserRouter, Router, Route, Routes } from "react-router-dom";
import Footer from "./components/Footer/Footer";
import Home from "./pages/Home/Home";
function App() {
  return (
    <div cl>
      <BrowserRouter>
        <div>
          <Navbar />
            <Routes>
              <Route
                path ='/home'
                exact
                element = {<Home />}
              />
            </Routes>
            <Footer /> 

        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
